import React from 'react';
import styles from './EducationalPreview.module.css';
import { ReactComponent as EmailSVG } from '../../icons/email.svg';
import { ReactComponent as PhoneSVG } from '../../icons/phone.svg';

class EducationalPreview extends React.Component {
  constructor(props) {
    super(props);
    this.state = {

    }
  }

  render() {
    return (
      <div className={styles['education']}>
        <div className={styles['contact']}>
          <h3>CONTACT</h3>

          <div className={styles['details']}>
            <div className={styles['detail']}>
              <img src={require("../../icons/address.png")}></img>
              <p>{this.props.info[2].value}</p>
            </div>

            <div className={styles['detail']}>
              <EmailSVG style={{ fill: "#a6a6a6" }} />
              <p>{this.props.info[3].value}</p>
            </div>

            <div className={styles['detail']}>
              <img></img>
              <p></p>
            </div>

            <div className={styles['detail']}>
              <img></img>
              <p>{this.props.info[4].value}</p>
            </div>
          </div>
        </div>
      </div>
    )
  }
}

export default EducationalPreview;
